import React from 'react';
import {
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer,
} from 'recharts';

const sampleData = [
  { date: '2025-07-20', collected: 12, sold: 0 },
  { date: '2025-07-21', collected: 15, sold: 6 },
  { date: '2025-07-22', collected: 9, sold: 5 },
  { date: '2025-07-23', collected: 13, sold: 10 },
];

const EggChart = () => {
  return (
    <div className="glass-box" style={{ height: 300 }}>
      <h2>Podsumowanie jajek</h2>
      <ResponsiveContainer width="100%" height="100%">
        <BarChart data={sampleData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="collected" fill="#82ca9d" name="Zebrane" />
          <Bar dataKey="sold" fill="#8884d8" name="Sprzedane" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default EggChart;
